import React, { Component } from 'react';
import { Container, Segment, Icon, Header, Divider } from 'semantic-ui-react';

class Footer extends Component {
  render() {
    return (
      <Segment inverted vertical style={{position:"fix", bottom:"0"}}>
        <Container>
          <Header as='h4' inverted textAlign='center'>
            <Icon name='ethereum'/>Block-Chain Based Question Answering System
          </Header>
          <p style={{textAlign:"center"}}>
           A Final Year Project | Powered by Ethereum | Created Using React JS
          </p>
        </Container>
      </Segment>
    );
  }
}

export default Footer;
